import React from "react";
import Filters from '../Filters'
import './index.css'
import Card from '../Card'

export default function Cards (props){
    console.log(props.perritos)
    return (
        <div>
            <Filters/>
            <div className="listado">
                <ul>
                  {props.perritos? props.perritos.map(perro => {
                      if (!perro.image.url || !perro.temperament || !perro.weight.metric) return <Card nombre = {perro.name}/>
                      return <Card nombre = {perro.name} img = {perro.image.url} temp = {perro.temperament} peso = {perro.weight.metric}/>
                  }): <h1>No hay perritos</h1>}
                </ul>
            </div>
        </div>
    )
}
